export default function Chat({rightChat, loggedUser}) {
    const [otherUser, setOtherUser]=useState(``)

    useEffect(()=>{
        loggedUser===rightChat.utente1? setOtherUser(rightChat.utente2):setOtherUser(rightChat.utente1)
        console.log(`1: ${otherUser}`)
        console.log(`2: ${loggedUser}`)
    },[])

    return (
        <>
            <p>{rightChat._id}</p>
            <p>{otherUser}</p>
        </>
    )
}
